import React, { useState } from "react";
import PropTypes from "prop-types";

const Header = (props) => {
  const [searchContext, setSearchContext] = useState("");

  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => {
    setIsOpen(!isOpen);
  };
  return <div></div>;
};

Header.propTypes = {};

export default Header;
